graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Deep Nested Machine</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_level1 {
    label="";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "level1" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>level1</b></td></tr></table>>, shape=plain, margin=0];
    "level1__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    subgraph cluster_level2 {
      label="";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      "level2" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>level2</b></td></tr></table>>, shape=plain, margin=0];
      "level2__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      subgraph cluster_level3 {
        label="";
        style=filled;
        fontsize=10;
        fillcolor="#FFFFFF";
        color="#999999";
        "level3" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>level3</b></td></tr></table>>, shape=plain, margin=0];
        "level3__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

        subgraph cluster_level4 {
          label="";
          style=filled;
          fontsize=10;
          fillcolor="#FFFFFF";
          color="#999999";
          "level4" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left" port="cluster_header"><b>level4</b></td></tr></table>>, shape=plain, margin=0];
          "level4__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

          "level5a" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>level5a</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
          "level5b" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>level5b</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
        }
      }
    }
  }

}
